COMMENT ON EXTENSION plpgsql IS 'PL/pgSQL procedural language';


SET search_path = public, pg_catalog;

--
-- Name: TradingLineAnalysisLoopFuncLeft(character varying, character varying, character varying, character varying, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION "TradingLineAnalysisLoopFuncLeft"(i_did character varying, i_tablename character varying, i_meta_data_name character varying, i_domain_id character varying, i_parentid character varying) RETURNS TABLE(id character varying, name character varying, domain_id character varying, view_id character varying, parent_id character varying, meta_view_name character varying, meta_data_name character varying, revision character varying, pro_info character varying)
    LANGUAGE plpgsql
    AS $_$
DECLARE
r RECORD ; r1 RECORD ; rSys RECORD ;
i_did VARCHAR;i_tableName VARCHAR;i_meta_data_name VARCHAR;i_domain_id VARCHAR;i_parentId varchar ;
alreadyExistIdCount INT ;
hasRelationCount INT ;
v_sql_count_relation VARCHAR;
BEGIN

--   i_parentId:='0';
select $1 into i_did;select $2 into i_tableName;select $3 into i_meta_data_name;select $4 into i_domain_id;
select $5 into i_parentId;
raise notice '---------------------------Parameter In metaDataName is: %,%', i_meta_data_name,i_did ;
--查找当前节点的投产信息。
  SELECT
		dObj.did ID, dObj. NAME, dObj.domain_id, dv_his. ID view_id, i_parentId parent_id,
		dv_his.meta_view_name, dObj.meta_data_name,dObj.revision,info.object_vid
	FROM
		de_pro_info info
	JOIN de_object_his dObj ON dObj.did = info.object_did
	AND dObj.vid = info.object_vid
	AND dObj.revision = info.object_version
	JOIN de_view_his dv_his ON dv_his.vid = info.object_vid
	AND dv_his.revision = info.object_version
	WHERE
		info.object_did = $1
	AND info.domain_id = $4
	AND info.is_last = '1'
	LIMIT 1 INTO r1 ;
--找到当前节点的最近投产信息，并继续往下分析。如若当前节点没有投产信息，直接忽略该节点。
	IF r1 IS NOT NULL THEN
		raise notice '[left analysis]---------------current node has last product info!' ;
		--判断最近投产版本，是否跟它的右1节点有关联，返回关联条数。
		v_sql_count_relation := 'select count(1) from de_object_relation_his r_his
							where r_his.vid = '''||r1.object_vid||''' and r_his.target_object_id = '''||i_parentId||''' and r_his.revision = '''||r1.revision||'''';
		raise notice '[left analysis:count relation to parent node for self last pro_info_version]%',v_sql_count_relation ;
EXECUTE v_sql_count_relation into hasRelationCount ;


		--找到最近投产版本，是否与右1节点有关联，有则插入数据库，并对该节点分析。(当然，排除原始节点，即parentId=0)
		IF hasRelationCount >= 1 OR i_parentId = '0' THEN
                --插入当前节点的投产信息进数据库
								EXECUTE 'insert into '|| $2 || ' values('''
																		|| r1. ID :: VARCHAR || ''',''' || r1. NAME :: VARCHAR || ''','''
																		|| r1.domain_id :: VARCHAR || ''',''' || r1. view_id :: VARCHAR || ''','''
																		|| r1. parent_id :: VARCHAR || ''',''' || r1. meta_view_name :: VARCHAR || ''',''' || r1. meta_data_name :: VARCHAR || ''','''
																		|| r1. revision :: VARCHAR || ''',''1'');' ;
								--判断当前节点是否已经分析过，已分析过的不分析。
								EXECUTE 'select count(1) from '|| $2 ||' where id = '''||r1.ID||''' ' into alreadyExistIdCount ;
								raise notice 'current node already analysis，name: %', r1.name ;
								IF alreadyExistIdCount < 3 THEN
													FOR r IN
														EXECUTE 'select r_his.source_object_id,r_his.meta_data_name
																from de_object_relation_his r_his
																join de_object_his obj_his on obj_his.did = r_his.source_object_id and obj_his.vid = r_his.vid and obj_his.revision = r_his.revision
																where r_his.target_object_id = '''||i_did||'''
																and r_his.meta_data_name in ('||i_meta_data_name||')

																UNION

																select r.source_object_id , r.meta_data_name
																from de_object_relation r
																join de_object obj on obj.did = r.source_object_id and obj.domain_id = r.domain_id
																where r.target_object_id = '''||i_did||'''
																and r.meta_data_name in ('||i_meta_data_name||')'
													LOOP
															IF r.source_object_id is not null THEN
																	raise notice 'Loop Nodes of source_object_id is: %, meta_data_name is:%', r.source_object_id, r.meta_data_name;
																	PERFORM "TradingLineAnalysisLoopFuncLeft"(r.source_object_id::VARCHAR,i_tableName,i_meta_data_name,i_domain_id,i_did);
															END IF;

													END LOOP;
								END IF ;
		END IF;

	ELSE
--如果当前节点没有投产态信息，那么判断当前节点是否是“系统”，如果是系统则插入数据库，因为系统默认都是投产态
		  SELECT
					dObj.did ID, dObj. NAME, dObj.domain_id, dv. ID view_id, i_parentId parent_id,
					dv.meta_view_name, dObj.meta_data_name, '' revision
			FROM
				 	 de_object dObj
			JOIN de_view_object_rel dvor on dvor.object_id = dObj.ID AND dvor. TYPE = '2'
		  JOIN de_view dv ON dvor.view_id = dv.ID
			WHERE
					dObj.did=$1
			AND dObj.domain_id=$4
			AND (dObj.meta_data_name = 'ApplicationSystem' or '0' = i_parentId)
			and (exists (select 1 from de_object_relation derel where derel.source_object_id = $1 and derel.target_object_id = i_parentId) or '0' = i_parentId)
			LIMIT 1 INTO rSys ;
			
			IF rSys IS NOT NULL THEN
					EXECUTE 'insert into '|| $2 || ' values(''' 
																		|| rSys. ID :: VARCHAR || ''',''' || rSys. NAME :: VARCHAR || ''',''' 
																		|| rSys.domain_id :: VARCHAR || ''',''' || rSys. view_id :: VARCHAR || ''',''' 
																		|| rSys. parent_id :: VARCHAR || ''',''' || rSys. meta_view_name :: VARCHAR || ''',''' || rSys. meta_data_name :: VARCHAR || ''',''' 
																		|| rSys. revision :: VARCHAR || ''',''0'');' ; 
			END IF ;
			

	END IF ;

	RETURN QUERY EXECUTE 'select t.* from ' || $2 || ' t where t.id is not null;' ;
	END ; $_$;


--
-- Name: TradingLineAnalysisLoopFuncRight(character varying, character varying, character varying, character varying, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION "TradingLineAnalysisLoopFuncRight"(i_did character varying, i_tablename character varying, i_meta_data_name character varying, i_domain_id character varying, i_parentid character varying) RETURNS TABLE(id character varying, name character varying, domain_id character varying, view_id character varying, parent_id character varying, meta_view_name character varying, meta_data_name character varying, revision character varying, pro_info character varying)
    LANGUAGE plpgsql
    AS $_$
DECLARE 
r RECORD ; r1 RECORD ; 
i_did VARCHAR;i_tableName VARCHAR;i_meta_data_name VARCHAR;i_domain_id VARCHAR;i_parentId varchar ;
alreadyExistIdCount INT ;
app_meta_data_name VARCHAR;
BEGIN
	
--   i_parentId:='0';
select $1 into i_did;select $2 into i_tableName;select $3 into i_meta_data_name;select $4 into i_domain_id;
select $5 into i_parentId;
raise notice '---------------------------Parameter In metaDataName is: %,%', i_meta_data_name,i_did ; 
--查找当前节点的投产信息。
  SELECT
		dObj.did ID, dObj. NAME, dObj.domain_id, dv_his. ID view_id, i_parentId parent_id,
		dv_his.meta_view_name, dObj.meta_data_name,dObj.revision,info.object_vid
	FROM
		de_pro_info info
	JOIN de_object_his dObj ON dObj.did = info.object_did
	AND dObj.vid = info.object_vid
	AND dObj.revision = info.object_version
	JOIN de_view_his dv_his ON dv_his.vid = info.object_vid
	AND dv_his.revision = info.object_version
	WHERE
		info.object_did = $1
	AND info.domain_id = $4
	AND info.is_last = '1'
	LIMIT 1 INTO r1 ;
--如果当前节点有投产态信息，那么记录到临时表。并继续往下分析。
	IF r1 IS NOT NULL THEN
		raise notice 'r1 not null' ; 
		EXECUTE 'insert into '|| $2 || ' values(''' 
												|| r1. ID :: VARCHAR || ''',''' || r1. NAME :: VARCHAR || ''',''' 
												|| r1.domain_id :: VARCHAR || ''',''' || r1. view_id :: VARCHAR || ''',''' 
												|| r1. parent_id :: VARCHAR || ''',''' || r1. meta_view_name :: VARCHAR || ''',''' || r1. meta_data_name :: VARCHAR || ''',''' 
												|| r1. revision :: VARCHAR || ''',''1'');' ; 
    EXECUTE 'select count(1) from '|| $2 ||' where id = '''||r1.ID||''' ' into alreadyExistIdCount ;
    raise notice 'Parameter In lareadyIdCount is: %', alreadyExistIdCount ; 
     IF alreadyExistIdCount=1 THEN
							FOR r IN
								EXECUTE 'select r_his.target_object_id,r_his.meta_data_name
										from de_object_relation_his r_his
										join de_object_his obj_his on obj_his.did = r_his.target_object_id and obj_his.vid = r_his.vid and obj_his.revision = r_his.revision
										where r_his.revision = '''||r1. revision||'''
										and r_his.vid = '''||r1.object_vid||'''
										and r_his.source_object_id = '''||i_did||''' 
										and r_his.meta_data_name in ('||i_meta_data_name||')'
							LOOP
									IF r.target_object_id is not null THEN
											raise notice 'Parameter of target_object_id is: %, meta_data_name is:%', r.target_object_id, r.meta_data_name;
											PERFORM "TradingLineAnalysisLoopFuncRight"(r.target_object_id::VARCHAR,i_tableName,i_meta_data_name,i_domain_id,i_did);
									END IF;
									
							END LOOP;
     END IF ;
		 
	ELSE
--如果当前节点没有投产态信息，记录它的最高版本信息到临时表中。
		EXECUTE 'insert into '|| $2 || ' select dObj.did ID, dObj. NAME, dObj.domain_id, dv. ID view_id, '''||i_parentId||''' parent_id,
				dv.meta_view_name, dObj.meta_data_name,dv.max_version revision,''0''
		from de_view_object_rel dv_rel
		join de_object dObj on dObj.id = dv_rel.object_id 
		join de_view dv on dv_rel.view_id = dv.id
		where dObj.did ='''||i_did||''' ;';

		EXECUTE 'select dObj.meta_data_name from de_object dObj where dObj.did ='''||i_did||''' ' into app_meta_data_name ;
		IF app_meta_data_name='ApplicationSystem' THEN
							FOR r IN
								EXECUTE 'select r.target_object_id,r.meta_data_name
										from de_object_relation r
										join de_object obj on obj.did = r.target_object_id
										where r.source_object_id = '''||i_did||''' 
										and r.domain_id = '''||i_domain_id||''' 
										and r.meta_data_name in ('||i_meta_data_name||')'
							LOOP
									IF r.target_object_id is not null THEN
											raise notice 'Current Node is Application.  current app did: %, meta_data_name is:%',i_did, app_meta_data_name;
											PERFORM "TradingLineAnalysisLoopFuncRight"(r.target_object_id::VARCHAR,i_tableName,i_meta_data_name,i_domain_id,i_did);
									END IF;
									
							END LOOP;
		End if;

	END IF ;

	RETURN QUERY EXECUTE 'select t.* from ' || $2 || ' t where t.id is not null;' ;
	END ; $_$;


--
-- Name: adcstatistics(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION adcstatistics(enddate character varying) RETURNS TABLE(category text, devnum bigint, instnum bigint)
    LANGUAGE plpgsql
    AS $_$
DECLARE 
endDateTime VARCHAR;
BEGIN
IF $1 = '' or $1 is null THEN
	select '3000-01-01' into endDateTime;
ELSE
	select $1||' 23:59:59' into endDateTime;
END If;
raise notice 'endDateTime is: %', endDateTime;


	RETURN QUERY SELECT
		T.category, T.devNum, T.instNum
	FROM (
		SELECT 	lookup(dev.category) :: TEXT AS category, 
				COALESCE(dev.num, 0) AS devNum,
				COALESCE(inst.num, 0) AS instNum
		FROM (
			(
				SELECT o.data ->> 'category' AS category, COUNT(*) AS num
				FROM de_object o
				JOIN "findObjectByIdAndMetaViewName"('ADC_V') v ON v.object_id = o.id
				where o.created_time <= endDateTime::timestamp
				 AND o.data ->> 'objStatus' != 'Purchasing'
				GROUP BY o.data ->> 'category'
			) AS dev
			FULL JOIN (
				SELECT o2.data ->> 'category' AS category, COUNT(*) AS num
				FROM de_object o
				JOIN "findObjectByIdAndMetaViewName"('ADCInst_V') v ON v.object_id = o.id
				LEFT JOIN de_object_relation r ON r.source_object_id = o.did AND r.meta_data_name = 'ADCInst2ADCPool'
				JOIN "findObjectByMetaViewName"('ADCPool_V') o2 ON o2.did = r.target_object_id	
				where o.data ->> 'objStatus' != 'Purchasing' AND o.created_time <= endDateTime::timestamp			
				GROUP BY o2.data ->> 'category'
			) AS inst ON inst.category = dev.category	
		) 
	) T;
END ;
$_$;


--
-- Name: computepoolstatistics(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION computepoolstatistics(enddate character varying) RETURNS TABLE(poolcategory text, poolname text, "dataJson" text)
    LANGUAGE plpgsql
    AS $_$
DECLARE 
endDateTime VARCHAR;
BEGIN
IF $1 = '' or $1 is null THEN
	select '3000-01-01' into endDateTime;
ELSE
	select $1||' 23:59:59' into endDateTime;
END If;

raise notice 'endDateTime is: %', endDateTime;

	RETURN QUERY SELECT
		T .poolCategory,
		T .poolName,
		row_to_json (T) :: TEXT dataJson  --将字段转json，方便后面扩展字段，不用修改代码（模型类的字段）。
	FROM
		(
			SELECT
				aa4.poolCategory,
				aa4.poolName,
				COALESCE (SUM(aa4."server_Num"), 0) :: NUMERIC AS "server_Num",
				COALESCE (SUM(aa4."vm_Num"), 0) :: NUMERIC AS "vm_Num",
				COALESCE (SUM(aa4."server_CPU"), 0) :: NUMERIC AS "server_CPU(C)",
				COALESCE (SUM(aa4."vm_CPU"), 0) :: NUMERIC AS "vm_CPU(vC)",
				devison_(COALESCE (SUM (aa4."vm_CPU"), 0)::varchar, COALESCE (SUM (aa4."server_VCPU"), 0)::varchar, 2) AS "CPU_allocated%",--计算CPU使用率（%）
				COALESCE (SUM(aa4."server_Mem"), 0) :: NUMERIC AS "server_Mem(GB)",
				COALESCE (SUM(aa4."vm_Mem"), 0) :: NUMERIC AS "vm_Mem(GB)",
				devison_(COALESCE (SUM (aa4."vm_Mem"), 0)::varchar, COALESCE (SUM (aa4."server_Mem"), 0)::varchar, 2) AS "MEM_allocated%" --计算内存使用率（%）
			FROM
				(
					SELECT
						(
							CASE aa3.poolCategory
							WHEN '129433' THEN
								'交易类'
							WHEN '129434' THEN
								'管理类'
							WHEN '129435' THEN
								'开发测试类'
							ELSE
								''
							END
						) poolCategory,
						aa3.poolName,
						(
							CASE
							WHEN aa3."type" = 'server' THEN
								aa3."cnt"
							END
						) AS "server_Num",
						(
							CASE
							WHEN aa3."type" = 'server' THEN
								aa3."CPU"
							END
						) AS "server_CPU",
						(
							CASE
							WHEN aa3."type" = 'server' THEN
								aa3."VCPU"
							END
						) AS "server_VCPU",
						(
							CASE
							WHEN aa3."type" = 'server' THEN
								aa3."Mem"
							END
						) AS "server_Mem",
						(
							CASE
							WHEN aa3."type" = 'vm' THEN
								aa3."cnt"
							END
						) AS "vm_Num",
						(
							CASE
							WHEN aa3."type" = 'vm' THEN
								aa3."VCPU"
							END
						) AS "vm_CPU",
						(
							CASE
							WHEN aa3."type" = 'vm' THEN
								aa3."Mem"
							END
						) AS "vm_Mem"
					FROM
						(
							SELECT
								tb_server.poolCategory,
								tb_server.poolName,
								'server' AS "type",
								COUNT (DISTINCT tb_server."did") AS "cnt",
								---汇总设备数量
								SUM (tb_server."CPU_core_num") AS "CPU",
								---汇总CPU
								SUM (tb_server."CPU_thread_num") AS "VCPU",
								---汇总VCPU
								SUM (tb_server."Memory_size") AS "Mem" ---汇总内存
							FROM
								(
									SELECT
										COALESCE (
											MAX (
												translate_to_number(
													obj_server. DATA ->> 'CPU_num'
												) * translate_to_number(
													obj_cpu. DATA ->> 'core'
												) - translate_to_number(
													obj_server. DATA ->> 'inactive_core'
												)
											),
											0
										) AS "CPU_core_num",
										---物理CPU：CPU数量*核-未激活核数
										COALESCE (
											MAX (
												translate_to_number(
													obj_server. DATA ->> 'CPU_num'
												) * translate_to_number(
													obj_cpu. DATA ->> 'core'
												) * translate_to_number(
													obj_server. DATA ->> 'tpc'
												) - translate_to_number(
													obj_server. DATA ->> 'inactive_core'
												)
											),
											0
										) AS "CPU_thread_num",
										---VCPU：CPU数量*核*每核线程数-未激活核数，用于计算CPU使用率
										COALESCE (
											MAX (
												translate_to_number(
													obj_server. DATA ->> 'memory_num'
												) * translate_to_number(
													obj_memory. DATA ->> 'capacity'
												)
											),
											0
										) AS "Memory_size",
										---计算内存：内存数量*内存大小
										obj_server.did,
										obj_pool. NAME AS poolName,
										obj_pool. DATA ->> 'category' poolCategory
									FROM
										de_object obj_server
									LEFT JOIN de_object_relation rel ON rel.target_object_id = obj_server.did
									AND rel.meta_data_name = 'ComputePool2Server'
									JOIN de_object obj_pool ON obj_pool.did = rel.source_object_id
									LEFT JOIN de_object_relation rel2 ON rel2.source_object_id = obj_server.did
									AND rel2.meta_data_name = 'use_the_CPU'
									JOIN de_object obj_cpu ON obj_cpu.did = rel2.target_object_id
									LEFT JOIN de_object_relation rel3 ON rel3.source_object_id = obj_server.did
									AND rel3.meta_data_name = 'use_this_memory'
									JOIN de_object obj_memory ON obj_memory.did = rel3.target_object_id
									WHERE
										1 = 1
									AND lookup (obj_server. DATA ->> 'objStatus') NOT IN ('已出库','采购中')
									AND obj_server.meta_data_name = 'Server'
									and obj_server.created_time <= endDateTime::timestamp
									GROUP BY
										obj_server.did,
										obj_pool. NAME,
										obj_pool. DATA ->> 'category'
								) tb_server
							WHERE
								1 = 1
							GROUP BY
								tb_server.poolCategory,
								tb_server.poolName
							UNION ALL
								SELECT
									obj_virtual_server.poolCategory,
									obj_virtual_server.poolName,
									'vm' AS "type",
									COUNT (
										DISTINCT obj_virtual_server."did"
									) AS "cnt",
									---汇总设备数量
									SUM (
										obj_virtual_server."CPU_thread_num"
									) AS "CPU",
									---汇总CPU
									SUM (
										obj_virtual_server."CPU_thread_num"
									) AS "VCPU",
									---汇总VCPU
									SUM (
										obj_virtual_server."Memory_size"
									) AS "Mem" ---汇总内存
								FROM
									(
										SELECT
											obj_virtual_server. NAME,
											obj_virtual_server.did,
											obj_pool. NAME AS poolName,
											obj_pool. DATA ->> 'category' poolCategory,
											MAX (
												translate_to_number(
													obj_HardwareResourceStandard. DATA ->> 'CPU'
												)
											) "CPU_thread_num",
											MAX (
												translate_to_number(
													obj_HardwareResourceStandard. DATA ->> 'memory'
												)
											) "Memory_size"
										FROM
											de_object obj_virtual_server
										LEFT JOIN de_object_relation rel ON rel.source_object_id = obj_virtual_server.did
										AND rel.meta_data_name = 'VirtualServer2ComputePool'
										JOIN de_object obj_pool ON obj_pool.did = rel.target_object_id
										LEFT JOIN de_object_relation rel2 ON rel2.source_object_id = obj_virtual_server.did
										AND rel2.meta_data_name = 'VirtualServer2HardwareResourceStandard'
										JOIN de_object obj_HardwareResourceStandard ON obj_HardwareResourceStandard.did = rel2.target_object_id
										WHERE
											1 = 1
										AND obj_virtual_server.meta_data_name = 'VirtualServer'
										AND lookup (obj_virtual_server. DATA ->> 'objStatus') IN ('已分配','拟回收')
										and obj_virtual_server.created_time <= endDateTime::timestamp
										GROUP BY
											obj_virtual_server. NAME,
											obj_virtual_server.did,
											obj_pool. NAME,
											obj_pool. DATA ->> 'category'
									) obj_virtual_server
								WHERE
									1 = 1
								GROUP BY
									obj_virtual_server.poolCategory,
									obj_virtual_server.poolName
						) aa3
				) aa4
			GROUP BY
				aa4.poolCategory,
				aa4.poolName
		) T
	ORDER BY
		T .poolCategory,
		T .poolName ;
	END ;
$_$;


--
-- Name: computeresourceusage(character varying, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION computeresourceusage(devtypeparam character varying, enddate character varying) RETURNS TABLE(poolcategory character varying, pooltype character varying, "dataJson" text)
    LANGUAGE plpgsql
    AS $_$
DECLARE
endDateTime VARCHAR;
BEGIN
IF $2 = '' or $2 is null THEN
	select '3000-01-01' into endDateTime;
ELSE
	select $2||' 23:59:59' into endDateTime;
END If;

raise notice 'endDateTime is: %', endDateTime;

	RETURN QUERY
	SELECT
		T.category poolCategory,
		T.pooltype,
		row_to_json (T) :: TEXT dataJson  --将字段转json，方便后面扩展字段，不用修改代码（模型类的字段）。
	FROM
		(
(
SELECT
		LEAST (dev.category, inst.category) :: VARCHAR AS category,  ---（交易类、管理类、开发测试类）
		'资源池' :: VARCHAR :: VARCHAR AS pooltype,  ---（资源池、非资源池）
		LEAST (dev.devtype, inst.devtype) :: VARCHAR AS devtype,  ---（Power、PowerLinux、x86）
		dev.cnt :: NUMERIC AS devtotal,   ---设备数量
		dev."CPU" :: NUMERIC AS "devcputotal(C)",   ---CPU总量
		devison_(COALESCE (dev."VCPU",0)::varchar, (COALESCE (dev."CPU",0)*100)::varchar, 2) AS tpcavg,	--计算TPC的平均值
		dev."Mem" :: NUMERIC AS "devmemtotal(GB)",  ---内存总量
		COALESCE (inst.cnt, 0) :: NUMERIC AS insttotal,  ---服务器实例数量
		COALESCE (inst."CPU", 0) :: NUMERIC AS "instcputotal(vC)",  ---CPU使用量
		COALESCE (inst."Mem", 0) :: NUMERIC AS "instmemtotal(GB)",  ---内存使用量
		devison_(COALESCE(inst."CPU",0)::varchar, COALESCE (dev."VCPU",0)::varchar, 2) AS "CPU_allocated%",    ---CPU使用率
    devison_(COALESCE (inst."Mem",0)::varchar, COALESCE (dev."Mem",0)::varchar, 2) AS "MEM_allocated%"   ---内存使用率
	FROM
		(
							SELECT
								tb_server.poolCategory category,
								tb_server.dev_type devtype,
								--'server' AS "type",
								COUNT (DISTINCT tb_server."did") AS "cnt",
								---汇总设备数量
								SUM (tb_server."CPU_core_num") AS "CPU",
								---汇总CPU
								SUM (tb_server."CPU_thread_num") AS "VCPU",
								---汇总VCPU
								SUM (tb_server."Memory_size") AS "Mem" ---汇总内存
							FROM

							(SELECT
								lookup(max(obj_server.data->>'devtype')) dev_type,
								lookup(obj_pool. DATA ->> 'category') poolCategory,
								COALESCE (
									MAX (
										translate_to_number(
											obj_server. DATA ->> 'CPU_num'
										) * translate_to_number(
											obj_cpu. DATA ->> 'core'
										) - translate_to_number(
											obj_server. DATA ->> 'inactive_core'
										)
									),
									0
								) AS "CPU_core_num",
								---物理CPU：CPU数量*核-未激活核数
								COALESCE (
									MAX (
										translate_to_number(
											obj_server. DATA ->> 'CPU_num'
										) * translate_to_number(
											obj_cpu. DATA ->> 'core'
										) * translate_to_number(
											obj_server. DATA ->> 'tpc'
										) - translate_to_number(
											obj_server. DATA ->> 'inactive_core'
										)
									),
									0
								) AS "CPU_thread_num",
								---VCPU：CPU数量*核*每核线程数-未激活核数，用于计算CPU使用率
								COALESCE (
									MAX (
										translate_to_number(
											obj_server. DATA ->> 'memory_num'
										) * translate_to_number(
											obj_memory. DATA ->> 'capacity'
										)
									),
									0
								) AS "Memory_size",
								---计算内存：内存数量*内存大小
								obj_server.did
							FROM
								de_object obj_server
							LEFT JOIN de_object_relation rel ON rel.target_object_id = obj_server.did
							AND rel.meta_data_name = 'ComputePool2Server'
							JOIN de_object obj_pool ON obj_pool.did = rel.source_object_id
							LEFT JOIN de_object_relation rel2 ON rel2.source_object_id = obj_server.did
							AND rel2.meta_data_name = 'use_the_CPU'
							JOIN de_object obj_cpu ON obj_cpu.did = rel2.target_object_id
							LEFT JOIN de_object_relation rel3 ON rel3.source_object_id = obj_server.did
							AND rel3.meta_data_name = 'use_this_memory'
							JOIN de_object obj_memory ON obj_memory.did = rel3.target_object_id
							WHERE
								1 = 1
							AND lookup(obj_server. DATA ->> 'objStatus') NOT IN ('已出库','采购中')
							AND obj_server.meta_data_name = 'Server'
							and obj_server.created_time <= endDateTime::timestamp
							GROUP BY
								obj_server.did,
								obj_pool. DATA ->> 'category'
							)tb_server

							GROUP BY
								tb_server.poolCategory,
								tb_server.dev_type
) AS dev   /*Server*/
	FULL JOIN (
							SELECT
									obj_virtual_server.poolCategory category,
									obj_virtual_server.dev_type devtype,
									COUNT (
										DISTINCT obj_virtual_server."did"
									) AS "cnt",
									---汇总设备数量
									SUM (
										obj_virtual_server."CPU_thread_num"
									) AS "CPU",
									---汇总CPU
									SUM (
										obj_virtual_server."Memory_size"
									) AS "Mem" ---汇总内存
								FROM
									(
										SELECT
											lookup(obj_pool.data->>'architecture') dev_type,
											lookup(obj_pool.DATA ->> 'category') poolCategory,
											obj_virtual_server.did,
											MAX (
												translate_to_number(
													obj_HardwareResourceStandard. DATA ->> 'CPU'
												)
											) "CPU_thread_num",
											MAX (
												translate_to_number(
													obj_HardwareResourceStandard. DATA ->> 'memory'
												)
											) "Memory_size"
										FROM
											de_object obj_virtual_server
										LEFT JOIN de_object_relation rel ON rel.source_object_id = obj_virtual_server.did
										AND rel.meta_data_name = 'VirtualServer2ComputePool'
										JOIN de_object obj_pool ON obj_pool.did = rel.target_object_id
										LEFT JOIN de_object_relation rel2 ON rel2.source_object_id = obj_virtual_server.did
										AND rel2.meta_data_name = 'VirtualServer2HardwareResourceStandard'
										JOIN de_object obj_HardwareResourceStandard ON obj_HardwareResourceStandard.did = rel2.target_object_id
										WHERE
											1 = 1
										AND obj_virtual_server.meta_data_name = 'VirtualServer'
										AND lookup (obj_virtual_server.data->>'objStatus') IN ('已分配','拟回收')
										and obj_virtual_server.created_time <= endDateTime::timestamp
										GROUP BY
												dev_type,
											obj_virtual_server.did,
											obj_pool. DATA ->> 'category'
									) obj_virtual_server
								WHERE
									1 = 1
								GROUP BY
									obj_virtual_server.poolCategory,
									dev_type
) AS inst /*VirtualServer*/ ON dev.category = inst.category
	AND dev.devtype = inst.devtype
	ORDER BY devtype

)

union all

(

SELECT
			LEAST (dev.category, inst.category) :: VARCHAR AS category,
			'非资源池' :: VARCHAR AS pooltype,
			LEAST (dev.devtype, inst.devtype) :: VARCHAR AS devtype,
			dev.devtotal :: NUMERIC,
			dev.devcputotal :: NUMERIC,
      devison_(COALESCE (dev.devvcputotal,0)::varchar, (COALESCE (dev.devcputotal,0)*100)::varchar, 2) AS tpcavg,
			dev.devmemtotal :: NUMERIC,
			COALESCE (inst.insttotal, 0) :: NUMERIC AS insttotal,
			COALESCE (inst.instcputotal, 0) :: NUMERIC AS instcputotal,
			COALESCE (inst.instmemtotal, 0) :: NUMERIC AS instmemtotal,
			devison_(COALESCE (inst.instcputotal,0)::varchar, COALESCE (dev.devvcputotal,0)::varchar, 2) AS "CPU_allocated%",
			devison_(COALESCE (inst.instmemtotal,0)::varchar, COALESCE (dev.devmemtotal,0)::varchar, 2) AS "MEM_allocated%"
		FROM
			(

					select
					category,
					devtype,
					COUNT (1) AS devtotal,
					SUM (
						"CPU_core_num"
					) AS devcputotal,  ----CPU总量（不乘线程数）
					SUM (
						"CPU_thread_num"
					) AS devvcputotal,   ----CPU使用量（乘线程数）
					SUM (
						"Memory_size"
					) AS devmemtotal
					from (
							SELECT
								lookup(max(obj_server.data->>'category')) category,
								lookup(max(obj_server.data->>'devtype')) devtype,
								COALESCE (
									MAX (
										translate_to_number(
											obj_server. DATA ->> 'CPU_num'
										) * translate_to_number(
											obj_cpu. DATA ->> 'core'
										) - translate_to_number(
											obj_server. DATA ->> 'inactive_core'
										)
									),
									0
								) AS "CPU_core_num",
								---物理CPU：CPU数量*核-未激活核数
								COALESCE (
									MAX (
										translate_to_number(
											obj_server. DATA ->> 'CPU_num'
										) * translate_to_number(
											obj_cpu. DATA ->> 'core'
										) * translate_to_number(
											obj_server. DATA ->> 'tpc'
										) - translate_to_number(
											obj_server. DATA ->> 'inactive_core'
										)
									),
									0
								) AS "CPU_thread_num",
								---VCPU：CPU数量*核*每核线程数-未激活核数，用于计算CPU使用率
								COALESCE (
									MAX (
										translate_to_number(
											obj_server. DATA ->> 'memory_num'
										) * translate_to_number(
											obj_memory. DATA ->> 'capacity'
										)
									),
									0
								) AS "Memory_size",
								---计算内存：内存数量*内存大小
								obj_server.did
							FROM
								de_object obj_server

							LEFT JOIN de_object_relation rel2 ON rel2.source_object_id = obj_server.did
									AND rel2.meta_data_name = 'use_the_CPU'
									JOIN de_object obj_cpu ON obj_cpu.did = rel2.target_object_id
							LEFT JOIN de_object_relation rel3 ON rel3.source_object_id = obj_server.did
									AND rel3.meta_data_name = 'use_this_memory'
									JOIN de_object obj_memory ON obj_memory.did = rel3.target_object_id
							WHERE
									1 = 1
									AND lookup(obj_server. DATA ->> 'objStatus') NOT IN ('已出库','采购中')
									AND obj_server.meta_data_name = 'Server'
									and obj_server.did not in (select  rel.target_object_id from de_object_relation rel join de_object o2 on o2.did = rel.source_object_id  where rel.meta_data_name = 'ComputePool2Server')
									and obj_server.created_time <= endDateTime::timestamp
								GROUP BY
									obj_server.did
					)"Server" GROUP BY
					"Server".category,
					"Server"."devtype"


)AS dev   /*Server*/
		FULL JOIN
(
			SELECT
				a1.category,
				a1.devtype,
				SUM (cnt) AS insttotal,
				SUM (cputotal) AS instcputotal,
				SUM (memtotal) AS instmemtotal
			FROM
				(
					(
						SELECT
								lookup(obj_server.data->>'category') category,
								lookup(obj_server.data->>'devtype') devtype,
								COUNT (1) AS cnt,

								sum( COALESCE (

										translate_to_number(
											obj_server. DATA ->> 'CPU_num'
										) * translate_to_number(
											obj_cpu. DATA ->> 'core'
										) * translate_to_number(
											obj_server. DATA ->> 'tpc'
										) - translate_to_number(
											obj_server. DATA ->> 'inactive_core'
										)
									,
									0
								) ) AS cputotal,
								---VCPU：CPU数量*核*每核线程数-未激活核数，用于计算CPU使用率
								sum( COALESCE (

										translate_to_number(
											obj_server. DATA ->> 'memory_num'
										) * translate_to_number(
											obj_memory. DATA ->> 'capacity'
										)
									,
									0
								) ) AS memtotal

							FROM
								de_object obj_server

							LEFT JOIN de_object_relation rel2 ON rel2.source_object_id = obj_server.did
									AND rel2.meta_data_name = 'use_the_CPU'
									JOIN de_object obj_cpu ON obj_cpu.did = rel2.target_object_id
							LEFT JOIN de_object_relation rel3 ON rel3.source_object_id = obj_server.did
									AND rel3.meta_data_name = 'use_this_memory'
									JOIN de_object obj_memory ON obj_memory.did = rel3.target_object_id
							WHERE
									1 = 1
									AND lookup(obj_server. DATA ->> 'objStatus') IN ('已分配','拟回收')
									AND obj_server.meta_data_name = 'Server'
									and obj_server.did in (select  rel.target_object_id from de_object_relation rel join de_object o2 on o2.did = rel.source_object_id where rel.meta_data_name = 'AppComponent2Server')
									and obj_server.created_time <= endDateTime::timestamp
							GROUP BY
									category,devtype
					)
					UNION ALL
						(
							SELECT

								lookup (obj_server.data->>'category') AS category,
								lookup (obj_server.data->>'devtype') AS devtype,
								COUNT (1) AS cnt,
								SUM (
									translate_to_number(obj_HardwareResourceStandard.data->>'CPU')
								) AS cputotal,
								SUM (
									translate_to_number(obj_HardwareResourceStandard.data->>'memory')
								) AS memtotal
							FROM
								de_object obj_server
								join de_object_relation rel on rel.target_object_id = obj_server.did and rel.meta_data_name = 'VirtualServer2Server'
								join de_object obj_virtual_server on obj_virtual_server.did = rel.source_object_id
								join de_object_relation rel2 on rel2.source_object_id = obj_virtual_server.did and rel2.meta_data_name = 'VirtualServer2HardwareResourceStandard'
								join de_object obj_HardwareResourceStandard on obj_HardwareResourceStandard.did = rel2.target_object_id
							WHERE
							lookup (obj_virtual_server.data->>'objStatus') IN ('已分配','拟回收')
							AND
							obj_server.did not in (select  rel.target_object_id from de_object_relation rel join de_object o2 on o2.did = rel.source_object_id  where rel.meta_data_name = 'ComputePool2Server')
							and obj_server.created_time <= endDateTime::timestamp
							GROUP BY category,devtype
						)
					UNION ALL
						(
							SELECT
								c1.category,
								c1.devtype,
								COUNT (c1.did) AS insttotal,
								sum( COALESCE (
												translate_to_number(
													c1. DATA ->> 'CPU_num'
												) * translate_to_number(
													obj_cpu. DATA ->> 'core'
												) * translate_to_number(
													c1. DATA ->> 'tpc'
												) - translate_to_number(
													c1. DATA ->> 'inactive_core'
												)
											,
											0
										) ) AS instcputotal,
								sum( COALESCE (
										translate_to_number(
											c1. DATA ->> 'memory_num'
										) * translate_to_number(
											obj_memory. DATA ->> 'capacity'
										)
									,
									0
								) ) AS memtotal

							FROM
								(

										SELECT
											obj_server.did,
											obj_server.data,
											lookup (obj_server.data->>'category') AS category,
											lookup (obj_server.data->>'devtype') AS devtype
										FROM
													de_object obj_server
											join de_object_relation rel on rel.target_object_id = obj_server.did and rel.meta_data_name = 'applicationdevtestserver'
											join de_object application on application.did = rel.source_object_id
										WHERE
											lookup (obj_server.data->>'objStatus') IN ('已分配','拟回收')
											and obj_server.created_time <= endDateTime::timestamp
								) AS c1
								LEFT JOIN de_object_relation rel2 ON rel2.source_object_id = c1.did
									AND rel2.meta_data_name = 'use_the_CPU'
									JOIN de_object obj_cpu ON obj_cpu.did = rel2.target_object_id
								LEFT JOIN de_object_relation rel3 ON rel3.source_object_id = c1.did
									AND rel3.meta_data_name = 'use_this_memory'
									JOIN de_object obj_memory ON obj_memory.did = rel3.target_object_id
							WHERE 1=1
							GROUP BY
								c1.category,
								c1.devtype
						)
				)a1
			GROUP BY
				a1.category,
				a1.devtype
		) AS inst ON dev.devtype = inst.devtype
		AND dev.category = inst.category
		ORDER BY
			devtype
)


	) T  where T.devtype=$1
	ORDER BY
		T .category,
		T .pooltype ;
	END ;
$_$;


--
-- Name: devison_(character varying, character varying, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION devison_(in_1 character varying, in_2 character varying, in_3 integer, OUT out_1 character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $_$
BEGIN

			raise notice 'PARAM: in_1=%,in_2=%', $1 , $2;
--判断空值

		IF $1 is null or $1=''  THEN

			select '参数错误,'||$1||'/'||$2 into "out_1";
			return;
		end if;

		IF $2 is null or $2=''  THEN

			select '参数错误,'||$1||'/'||$2 into "out_1";
			return;
		end if;


--判断是否是数字
if $1 ~ '^([0-9]+[.]?[0-9]*|[.][0-9]+)$' and $2 ~ '^([0-9]+[.]?[0-9]*|[.][0-9]+)$'  THEN

else
    select '参数错误,'||$1||'/'||$2 into "out_1";
		return;
end if;


	 select COALESCE (
			round(
				in_1 :: NUMERIC / in_2 :: NUMERIC * 100,
				$3
			),
			0
		)  into "out_1" ;
		EXCEPTION
    WHEN division_by_zero THEN
        select '参数错误,'||$1||'/'||$2 into "out_1";


END ;
$_$;


--
-- Name: findObjectByIdAndMetaViewName(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION "findObjectByIdAndMetaViewName"(x character varying, OUT object_id character varying) RETURNS SETOF character varying
    LANGUAGE sql
    AS $$
SELECT vor.object_id
	FROM de_view v
	JOIN de_view_object_rel vor ON vor.view_id = v.id	
	WHERE v.meta_view_name = x;
$$;


--
-- Name: findObjectByMetaViewName(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION "findObjectByMetaViewName"(x character varying) RETURNS TABLE(did character varying, data json, created_time timestamp without time zone)
    LANGUAGE plpgsql
    AS $$
BEGIN RETURN QUERY 
	SELECT o.did AS did, o.data,o.created_time AS data 
	FROM de_view v
	JOIN de_view_object_rel vor ON vor.view_id = v.id
	JOIN de_object o ON o.id = vor.object_id
	WHERE v.meta_view_name = x;
END;
$$;


--
-- Name: getTarget(character varying, character varying, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION "getTarget"(i_did character varying, i_domain_id character varying, i_meta_name character varying) RETURNS TABLE(id character varying, did character varying, project_id character varying, domain_id character varying, name text, rid text)
    LANGUAGE plpgsql
    AS $_$
BEGIN
	RETURN QUERY 
		select inr.id, inr.did, inr.project_id, inr.domain_id, inr.name, r.rid::text
		from de_object_relation r 
		join de_object inr on inr.did = r.target_object_id and inr.domain_id = r.domain_id
		where r.domain_id = $2
		and r.source_object_id = $1
		and r.meta_data_name = $3;
	RETURN;
END;
$_$;


--
-- Name: getTargetHisMax(character varying, character varying, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION "getTargetHisMax"(i_did character varying, i_domain_id character varying, i_meta_name character varying) RETURNS TABLE(id character varying, did character varying, vid character varying, revision numeric, project_id character varying, domain_id character varying, name text, rid text)
    LANGUAGE plpgsql
    AS $_$
BEGIN
	RETURN QUERY 
		select his.id, his.did, his.vid, his.revision, his.project_id, his.domain_id, his.name, r.rid::text
		from de_object_relation r 
 		join de_object inr on inr.did = r.target_object_id and inr.domain_id = r.domain_id
		join de_view_object_rel rel on rel.object_id = inr.id
		join de_view v on v.id = rel.view_id
    join de_pro_info info on info.object_did = inr.did and info.domain_id = inr.domain_id      
          and info.is_last='1'
		join de_object_his his on his.did= inr.did and his.domain_id=inr.domain_id and his.vid = v.vid
					and his.revision = info.object_version
		where r.source_object_id = $1
		 and r.domain_id = $2
		and r.meta_data_name = $3;
	RETURN;
END;
$_$;


--
-- Name: lookup(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION lookup(code character varying, OUT description character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $_$
BEGIN
		IF $1 is null THEN
			raise notice 'PARAM: %', $1 ;
			select '' into "description";
			return;
		end if;
	 EXECUTE 'SELECT CASE '''||$1||'''

					WHEN ''129433'' THEN ''交易类''
					WHEN ''128373'' THEN ''交易类''
					WHEN ''129434'' THEN ''管理类''
					WHEN ''128374'' THEN ''管理类''
					WHEN ''129435'' THEN ''开发测试类''
					WHEN ''128375'' THEN ''开发测试类''

					WHEN ''2025'' THEN ''PowerLinux''
					WHEN ''2026'' THEN ''x86''
					WHEN ''2027'' THEN ''Power''
					WHEN ''2024'' THEN ''PureApplication''
					WHEN ''79836'' THEN ''AS400''
					WHEN ''2028'' THEN ''Storage''

					WHEN ''1717'' THEN ''Power''
					WHEN ''1716'' THEN ''x86''
					WHEN ''1718'' THEN ''PowerLinux''
					WHEN ''69960'' THEN ''在线''
					WHEN ''128243'' THEN ''在线''
					WHEN ''69961'' THEN ''近线''
					WHEN ''128244'' THEN ''近线''

					WHEN ''70907'' THEN ''拟回收''
					WHEN ''70906'' THEN ''已分配''
					WHEN ''70908'' THEN ''已回收''
					WHEN ''70905'' THEN ''拟分配''
					WHEN ''133553'' THEN ''拟淘汰''
					WHEN ''133554'' THEN ''已出库''
					WHEN ''133552'' THEN ''已入库''

					WHEN ''133558'' THEN ''已入库''
					WHEN ''133849'' THEN ''拟分配''
					WHEN ''133850'' THEN ''已分配''
					WHEN ''133851'' THEN ''拟回收''
					WHEN ''133852'' THEN ''已回收''
					WHEN ''133853'' THEN ''拟淘汰''
					WHEN ''133854'' THEN ''已出库''
					WHEN ''Purchasing'' THEN ''采购中''

					WHEN ''80314'' THEN ''Power''
					WHEN ''80313'' THEN ''x86''
					WHEN ''107846'' THEN ''PowerLinux''

					else '''||$1||'''
					END AS NAME ' into "description" ;
END ;
$_$;


--
-- Name: relationattribute(text, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION relationattribute(rids text, i_domain_id character varying) RETURNS TABLE(id integer, s_id character varying, t_id character varying, data json, name text, code text, meta_name character varying)
    LANGUAGE plpgsql
    AS $_$
DECLARE
	v_did varchar(32);
	rec record;
  idx INTEGER;
BEGIN
	CREATE TEMP TABLE rid_tmp(
		rid text
	) ON COMMIT DROP;

	CREATE TEMP TABLE result_tmp(
		idx INTEGER,
		source_object_id varchar(32),
		target_object_id varchar(32),
		data json,
		obj_data json,
		obj_meta_data_name varchar(50),
		meta_data_name varchar(50)
	) ON COMMIT DROP;
		
	idx = 0;

	FOR rec IN 
		SELECT * from regexp_split_to_table($1, '\|') as rids 
	LOOP
		
		INSERT into rid_tmp
		select * from
		regexp_split_to_table(rec.rids, ',') as rid;

		insert into result_tmp
		select idx as idx,r.source_object_id,r.target_object_id,r.data,o.data as obj_data,o.meta_data_name as obj_meta_data_name,r.meta_data_name 
		FROM rid_tmp t
		join de_object_relation r on r.rid=t.rid and r.domain_id = $2
		join de_object o on o.did = r.target_object_id and o.domain_id = r.domain_id;
		
		idx = idx + 1;
		delete from rid_tmp;	
	END LOOP;

	RETURN QUERY SELECT
		T .idx,
		T .source_object_id,
		T .target_object_id,
		T . DATA,
		(T .obj_data -> 'name') :: TEXT AS NAME,
		(
			CASE WHEN T .obj_meta_data_name='ServiceMethodList' 
			THEN(T .obj_data -> 'num')
			ELSE(T .obj_data -> 'interfaceTransactionCode')
			END
		) :: TEXT AS code,
		T .meta_data_name
	FROM
		result_tmp T ;
	RETURN;
END;
$_$;


--
-- Name: relationattributepro(text, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION relationattributepro(rids text, i_domain_id character varying) RETURNS TABLE(id integer, s_id character varying, t_id character varying, data json, name text, code text, meta_name character varying, type character varying)
    LANGUAGE plpgsql
    AS $_$
DECLARE
	v_did varchar(32);
	rec record;
  v_index INTEGER;
  v_count INTEGER;
  v_c INTEGER;
BEGIN
	CREATE TEMP TABLE rid_tmp(
		rid text,
		num int
	) ON COMMIT DROP;

	CREATE TEMP TABLE result_tmp(
		idx INTEGER,
		source_object_id varchar(32),
		target_object_id varchar(32),
		rid varchar(32),
		data json,
		obj_data json,
		obj_meta_data_name varchar(50),
		meta_data_name varchar(50),
		type varchar(1)
	) ON COMMIT DROP;
		
	v_index = 0;

	FOR rec IN 
		SELECT * from regexp_split_to_table($1, '\|') as rids 
	LOOP
		
		INSERT into rid_tmp
		select rid, row_number() OVER () as num from
		regexp_split_to_table(rec.rids, ',') as rid;
    
    select count(*) from rid_tmp into v_count;		
		
		insert into result_tmp
		select v_index as idx,r.source_object_id,r.target_object_id,r.rid,r.data,o.data as obj_data,o.meta_data_name as obj_meta_data_name,r.meta_data_name,'0' as type 
		FROM rid_tmp t
		join de_object_relation_his r on r.rid=t.rid and r.domain_id = $2
		join de_pro_info info on info.object_did = r.target_object_id and info.domain_id = r.domain_id 
				 and info.is_last='1'
		join de_object_his o on o.did = info.object_did and o.domain_id = info.domain_id
					and o.revision=info.object_version and o.vid=info.object_vid
		where t.num<v_count and t.num>1;
		--没用投产态，取设计态的历史最高
		select count(*) into v_c from result_tmp t where t.idx=v_index;

		insert into result_tmp
		with RECURSIVE cte as
		(
			select r.source_object_id,r.target_object_id,r.rid,r.data,o.data as obj_data,o.meta_data_name as obj_meta_data_name,r.meta_data_name,o.revision
			FROM rid_tmp t
			join de_object_relation_his r on r.rid=t.rid and r.domain_id = $2
			join de_object_his o on o.did = r.target_object_id and o.domain_id = r.domain_id
			where t.num<v_count and t.num>1
			and not EXISTS (
				select 1 from result_tmp o2 where r.rid=o2.rid
			)
		)select v_index as idx,source_object_id,target_object_id,rid,a.data,obj_data,meta_data_name as obj_meta_data_name,meta_data_name,'1' as type
			from cte a where a.revision=(select max(revision) from cte b where a.rid = b.rid);

		--没用设计态的历史最高，取现行

		insert into result_tmp
		select v_index as idx,r.source_object_id,r.target_object_id,r.rid,r.data,o.data as obj_data,o.meta_data_name as obj_meta_data_name,r.meta_data_name,'1' as type 
		FROM rid_tmp t
		join de_object_relation r on r.rid=t.rid and r.domain_id = $2
		join de_object o1 on o1.did = r.target_object_id and o1.domain_id = r.domain_id
		join de_view_object_rel rel on rel.object_id=o1.id 
		join de_view v on v.id = rel.view_id 
		join de_object_his o on o.did=o1.did and o.domain_id=o1.domain_id and o.revision=v.max_version
		where t.num<v_count and t.num>1
		and not EXISTS (
			select 1 from result_tmp o2 where r.rid=o2.rid
		);

		insert into result_tmp
		select v_index as idx,r.source_object_id,r.target_object_id,r.rid,r.data,o.data as obj_data,o.meta_data_name as obj_meta_data_name,r.meta_data_name,'0' as type 
		FROM rid_tmp t
		join de_object_relation r on r.rid=t.rid and r.domain_id = $2
		join de_object o on o.did = r.target_object_id and o.domain_id = r.domain_id
		where t.num=v_count or t.num=1;

		v_index = v_index + 1;
		delete from rid_tmp;	
	END LOOP;

	RETURN QUERY SELECT
		T .idx,
		T .source_object_id,
		T .target_object_id,
		T . DATA,
		(T .obj_data -> 'name') :: TEXT AS NAME,
		(
			CASE WHEN T .obj_meta_data_name='ServiceMethodList' 
			THEN(T .obj_data -> 'num')
			ELSE(T .obj_data -> 'interfaceTransactionCode')
			END
		) :: TEXT AS code,
		T .meta_data_name,
		T.type
	FROM
		result_tmp T ;
	RETURN;
END;
$_$;


--
-- Name: relationship(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION relationship(app_id character varying) RETURNS TABLE(id character varying, did character varying, project_id character varying, domain_id character varying, name text, view_id character varying, rid text)
    LANGUAGE plpgsql COST 10 ROWS 100
    AS $_$
DECLARE
	v_did varchar(32);
	v_domain_id varchar(32);
BEGIN
	select obj.did, obj.domain_id
	FROM de_object obj where obj.id = $1
	INTO v_did,v_domain_id;
	 raise notice '%', v_did;
	--查询接口
	CREATE TEMP TABLE interface_tmp ON COMMIT DROP AS  
	select * from
	"getTarget"(v_did,v_domain_id,'iliToAsy2'::VARCHAR);
				
	PREPARE getObject (varchar) AS
	select o2.id,o2.did,o2.project_id,o2.name,o2.domain_id,o.rid||','||r.rid::text as rid from de_object_relation r
	join interface_tmp o on r.target_object_id = o.did
	and r.domain_id = o.domain_id
	join de_object o2 on o2.did = r.source_object_id 
	and o2.domain_id = r.domain_id
	where r.meta_data_name = $1;

	--接口调用接口
	CREATE TEMP TABLE interface1_tmp ON COMMIT DROP AS  
	EXECUTE getObject('iliToIli');

	--场景调用接口
	CREATE TEMP TABLE scene_tmp ON COMMIT DROP AS  
	EXECUTE getObject('smlToIli');

	--功能调用接口
	CREATE TEMP TABLE func_tmp ON COMMIT DROP AS  
	EXECUTE getObject('afuToIfl');
	
	--接口调用场景
	insert into interface1_tmp
	select o2.id,o2.did,o2.project_id,o2.name,o2.domain_id,o.rid||','||r.rid::text as rid from de_object_relation r
	join scene_tmp o on r.target_object_id = o.did
	and r.domain_id = o.domain_id
	join de_object o2 on o2.did = r.source_object_id 
	and o2.domain_id = r.domain_id
	where r.meta_data_name = 'iflToSml';

	--功能调用场景
	insert into func_tmp
	select o2.id,o2.did,o2.project_id,o2.name,o2.domain_id,o.rid||','||r.rid::text as rid from de_object_relation r
	join scene_tmp o on r.target_object_id = o.did
	and r.domain_id = o.domain_id
	join de_object o2 on o2.did = r.source_object_id 
	and o2.domain_id = r.domain_id
	where r.meta_data_name = 'afuToSml';
		
	CREATE TEMP TABLE app_tmp ON COMMIT DROP AS  
	select o2.id,o2.did,o2.project_id,o2.name,o2.domain_id,o.rid||','||r.rid::text as rid  from de_object_relation r
	join func_tmp o on r.target_object_id = o.did
	and r.domain_id = o.domain_id
	join de_object o2 on o2.did = r.source_object_id 
	and o2.domain_id = r.domain_id
	where r.meta_data_name = 'asyToAfu';

	insert into app_tmp
	select o2.id,o2.did,o2.project_id,o2.name,o2.domain_id,o.rid||','||r.rid::text as rid from de_object_relation r
	join scene_tmp o on r.target_object_id = o.did
	and r.domain_id = o.domain_id
	join de_object o2 on o2.did = r.source_object_id 
	and o2.domain_id = r.domain_id
	where r.meta_data_name = 'asyToSml';

	insert into app_tmp
	select o2.id,o2.did,o2.project_id,o2.name,o2.domain_id,o.rid||','||r.rid::text as rid from de_object_relation r
	join interface1_tmp o on r.target_object_id = o.did
	and r.domain_id = o.domain_id
	join de_object o2 on o2.did = r.source_object_id 
	and o2.domain_id = r.domain_id
	where r.meta_data_name = 'iliToAsy2';

	insert into app_tmp
	select o2.id,o2.did,o2.project_id,o2.name,o2.domain_id,o.rid||','||r.rid::text as rid from de_object_relation r
	join interface_tmp o on r.target_object_id = o.did
	and r.domain_id = o.domain_id
	join de_object o2 on o2.did = r.source_object_id 
	and o2.domain_id = r.domain_id
	where r.meta_data_name = 'iliToAsy1';
	
	DEALLOCATE getObject;
	RETURN QUERY SELECT t.id,t.did,t.project_id,t.domain_id,t.name,v.id,t.rid FROM app_tmp t
	join de_view_object_rel r on r.object_id = t.id
	and r.type='2'
	join de_view v on v.id = r.view_id;  
	RETURN;

END;
$_$;


