BEGIN
	v_filter_by_scene := $2;
	select obj.did, obj.domain_id
	FROM de_object obj where obj.id = $1
	INTO v_did,v_domain_id;
	 raise notice '%', v_did;
	--查询接口
  DROP TABLE IF EXISTS interface_tmp;--事务内多次执行
	CREATE TEMP TABLE interface_tmp ON COMMIT DROP AS
	select * from
	"getTarget"(v_did,v_domain_id,'iliToAsy2'::VARCHAR);

	PREPARE getObject (varchar) AS
