		select o2.id,o2.did,o2.project_id,o2.name,o2.domain_id,o.rid||','||r.rid::text as rid from de_object_relation r
		join scene_tmp o on r.target_object_id = o.did
		and r.domain_id = o.domain_id
		join de_object o2 on o2.did = r.source_object_id
		and o2.domain_id = r.domain_id
		where r.meta_data_name = 'afuToSml';
  ELSE
		--接口调用场景
		insert into interface1_tmp
		select o2.id,o2.did,o2.project_id,o2.name,o2.domain_id,o.rid||','||r.rid::text as rid from de_object_relation r
		join scene_tmp o on r.target_object_id = o.did
		and r.domain_id = o.domain_id
		join de_object o2 on o2.did = r.source_object_id
		and o2.domain_id = r.domain_id
		where r.meta_data_name = 'iflToSml';

		--功能调用场景
		insert into func_tmp
		select o2.id,o2.did,o2.project_id,o2.name,o2.domain_id,o.rid||','||r.rid::text as rid from de_object_relation r
		join scene_tmp o on r.target_object_id = o.did
