  DROP TABLE IF EXISTS func_tmp1;--事务内多次执行
	CREATE TEMP TABLE func_tmp1 ON COMMIT DROP AS  
	select * from
	"getTarget"(v_did,v_domain_id,'asyToAfu'::VARCHAR);

	insert into scene_tmp1
	select o2.id, o2.did, o2.project_id,o2.domain_id,o2.name,o.rid||','||r.rid::text as rid from func_tmp1 o
	join de_object_relation r on r.source_object_id = o.did
	and r.domain_id = o.domain_id and  r.meta_data_name = 'afuToSml'
	join de_object o2 on o2.did = r.target_object_id
	and o2.domain_id = r.domain_id;

	insert into scene_tmp1
	select o2.id, o2.did, o2.project_id,o2.domain_id,o2.name,o.rid||','||r.rid::text as rid from interface_tmp1 o
	join de_object_relation r on r.source_object_id = o.did
	and r.domain_id = o.domain_id and  r.meta_data_name = 'iflToSml'
	join de_object o2 on o2.did = r.target_object_id
	and o2.domain_id = r.domain_id;

  DROP TABLE IF EXISTS interface1_tmp1;--事务内多次执行
	CREATE TEMP TABLE interface1_tmp1 ON COMMIT DROP AS  
	select o2.id, o2.did, o2.project_id,o2.domain_id,o2.name,o.rid||','||r.rid::text as rid from scene_tmp1 o
	join de_object_relation r on r.source_object_id = o.did
	and r.domain_id = o.domain_id and  r.meta_data_name = 'smlToIli'
	join de_object o2 on o2.did = r.target_object_id
	and o2.domain_id = r.domain_id;

  IF NOT v_filter_by_scene THEN
		insert into interface1_tmp1
		select o2.id, o2.did, o2.project_id,o2.domain_id,o2.name,o.rid||','||r.rid::text as rid from func_tmp1 o
		join de_object_relation r on r.source_object_id = o.did
		and r.domain_id = o.domain_id and  r.meta_data_name = 'afuToIfl'
		join de_object o2 on o2.did = r.target_object_id
		and o2.domain_id = r.domain_id;

		insert into interface1_tmp1
		select o2.id, o2.did, o2.project_id,o2.domain_id,o2.name,o.rid||','||r.rid::text as rid from interface_tmp1 o
		join de_object_relation r on r.source_object_id = o.did
		and r.domain_id = o.domain_id and  r.meta_data_name = 'iliToIli'
		join de_object o2 on o2.did = r.target_object_id
		and o2.domain_id = r.domain_id;

		insert into interface1_tmp1
		select * from
		"getTarget"(v_did,v_domain_id,'iliToAsy1'::VARCHAR);
	END IF;
	
  DROP TABLE IF EXISTS app_tmp1;--事务内多次执行
	CREATE TEMP TABLE app_tmp1 ON COMMIT DROP AS  
	select o2.id, o2.did, o2.project_id,o2.domain_id,o2.name,o.rid||','||r.rid::text as rid from interface1_tmp1 o
	join de_object_relation r on r.target_object_id = o.did
	and r.domain_id = o.domain_id and  r.meta_data_name = 'iliToAsy2'
	join de_object o2 on o2.did = r.source_object_id
	and o2.domain_id = r.domain_id;

	RETURN QUERY SELECT t.id,t.did,t.project_id,t.domain_id,t.name,v.id,t.rid FROM app_tmp1 t
	join de_view_object_rel r on r.object_id = t.id
	and r.type='2'
	join de_view v on v.id = r.view_id;  

	RETURN;

END;
$_$;


--
-- Name: relationshippro(character varying, boolean); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION relationshippro(app_id character varying, filter_by_scene boolean) RETURNS TABLE(id character varying, did character varying, project_id character varying, domain_id character varying, name text, view_id character varying, rid text)
    LANGUAGE plpgsql COST 10 ROWS 100
    AS $_$
DECLARE
	v_did varchar(32);
	v_domain_id varchar(32);
  v_sql varchar;
  v_sql1 varchar;
  v_sql2 varchar;
	v_filter_by_scene BOOLEAN;
BEGIN
	v_filter_by_scene := $2;	
	select obj.did, obj.domain_id
	FROM de_object obj 
  where obj.id = $1
	INTO v_did,v_domain_id;

	--查询接口
  DROP TABLE if EXISTS interface_tmp; --事务内多次调用
	CREATE TEMP TABLE interface_tmp ON COMMIT DROP AS  
	select * from
	"getTargetHisMax"(v_did,v_domain_id,'iliToAsy2'::VARCHAR);


	PREPARE getObject (varchar) AS
	select o2.id,o2.did,o2.vid,o2.revision,o2.project_id,o2.name,o2.domain_id,o.rid||','||r.rid::text as rid 
	from de_object_relation_his r
	join interface_tmp o on r.target_object_id = o.did
	and r.domain_id = o.domain_id and r.data->>'_target_vid'=o.vid
  --and (r.data->>'_target_version')::NUMERIC>=o.revision
	join de_object_his o2 on o2.did = r.source_object_id 
	and o2.domain_id = r.domain_id and o2.vid=r.vid and o2.revision=r.revision 
  join de_pro_info info on info.object_did=o2.did  and info.domain_id=o2.domain_id
  and info.is_last='1' and info.object_version=o2.revision
	where r.meta_data_name = $1;
	
	if v_filter_by_scene THEN
		--场景调用接口
    DROP TABLE if EXISTS scene_tmp; --事务内多次调用
		CREATE TEMP TABLE scene_tmp ON COMMIT DROP AS  
		EXECUTE getObject('smlToIli');
	ELSE 
		--场景调用接口
    DROP TABLE if EXISTS scene_tmp; --事务内多次调用
		CREATE TEMP TABLE scene_tmp ON COMMIT DROP AS  
		EXECUTE getObject('smlToIli');
		
		--接口调用接口
    DROP TABLE if EXISTS interface1_tmp; --事务内多次调用
		CREATE TEMP TABLE interface1_tmp ON COMMIT DROP AS  
		EXECUTE getObject('iliToIli');

		--功能调用接口
    DROP TABLE if EXISTS func_tmp; --事务内多次调用
		CREATE TEMP TABLE func_tmp ON COMMIT DROP AS  
		EXECUTE getObject('afuToIfl');
	END IF;

	v_sql := 'select o2.id,o2.did,o2.vid,o2.revision,o2.project_id,o2.name,o2.domain_id,o.rid||'',''||r.rid::text as rid 
  from de_object_relation_his r
	join %I o on r.target_object_id = o.did
	and r.domain_id = o.domain_id and r.data->>''_target_vid''=o.vid
	join de_object_his o2 on o2.did = r.source_object_id 
	and o2.domain_id = r.domain_id and o2.vid=r.vid and o2.revision=r.revision 
  join de_pro_info info on info.object_did=o2.did  and info.domain_id=o2.domain_id
  and info.is_last=''1'' and info.object_version=o2.revision
	where r.meta_data_name = $1';

	if v_filter_by_scene THEN
    DROP TABLE if EXISTS interface1_tmp; --事务内多次调用
		v_sql1 = 'CREATE TEMP TABLE interface1_tmp ON COMMIT DROP AS ' || v_sql;
		--接口调用场景
		EXECUTE format(v_sql1, 'scene_tmp') USING 'iflToSml';

    DROP TABLE if EXISTS func_tmp; --事务内多次调用
		v_sql1 = 'CREATE TEMP TABLE func_tmp ON COMMIT DROP AS ' || v_sql;
		--功能调用场景
		EXECUTE format(v_sql1, 'scene_tmp') USING 'afuToSml';			
	ELSE
		v_sql1 = 'insert into %I ' || v_sql;
		--接口调用场景
		EXECUTE format(v_sql1, 'interface1_tmp', 'scene_tmp') USING 'iflToSml';
		--功能调用场景
		EXECUTE format(v_sql1, 'func_tmp', 'scene_tmp') USING 'afuToSml';
	END IF;

	v_sql1 := 'select o2.id,o2.did,o2.project_id,o2.domain_id,o2.name,o.rid||'',''||r.rid::text as rid 
	from %I o
	join de_object_relation r on r.target_object_id = o.did
	and r.domain_id = o.domain_id and r.meta_data_name = $1
	join de_object o2 on o2.did = r.source_object_id
	and o2.domain_id = r.domain_id';
	
  DROP TABLE if EXISTS app_tmp; --事务内多次调用
	v_sql2 = 'CREATE TEMP TABLE app_tmp ON COMMIT DROP AS ' || v_sql1;
	EXECUTE format(v_sql2, 'func_tmp') USING 'asyToAfu';
	
	v_sql1 = 'insert into %I ' || v_sql1;

	EXECUTE format(v_sql1, 'app_tmp', 'scene_tmp') USING 'asyToSml';

	EXECUTE format(v_sql1, 'app_tmp', 'interface1_tmp') USING 'iliToAsy2';

	IF NOT v_filter_by_scene THEN
		EXECUTE format(v_sql1, 'app_tmp', 'interface_tmp') USING 'iliToAsy1';
	END IF;
	
	DEALLOCATE getObject;
	RETURN QUERY SELECT t.id,t.did,t.project_id,t.domain_id,t.name,v.id,t.rid FROM app_tmp t
	join de_view_object_rel r on r.object_id = t.id
	and r.type='2'
	join de_view v on v.id = r.view_id and v.status<>'0';
	RETURN;

END;
$_$;


--
-- Name: relationshippro1(character varying, boolean); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION relationshippro1(app_id character varying, filter_by_scene boolean) RETURNS TABLE(id character varying, did character varying, project_id character varying, domain_id character varying, name text, view_id character varying, rid text, type character varying)
    LANGUAGE plpgsql COST 10 ROWS 100
    AS $_$
DECLARE
	v_did varchar(32);
	v_domain_id varchar(32);
  v_sql varchar;
  v_sql1 varchar;
  v_sql2 varchar;
  v_sql3 varchar;
	v_filter_by_scene BOOLEAN;
BEGIN
	v_filter_by_scene := $2;
	select obj.did, obj.domain_id
	FROM de_object obj 
  where obj.id = $1
	INTO v_did,v_domain_id;

	--接口查询
  drop table if exists interface_tmp1; --事务内多次调用
	CREATE TEMP TABLE interface_tmp1 ON COMMIT DROP AS  
	select t.*, '0'::varchar as type from
	"getTargetHisMax"(v_did,v_domain_id,'iliToAsy2'::VARCHAR) t;
	--场景查询
  drop table if exists scene_tmp1; --事务内多次调用
	CREATE TEMP TABLE scene_tmp1 ON COMMIT DROP AS  
	select t.*, '0'::varchar as type from
	"getTargetHisMax"(v_did,v_domain_id,'asyToSml'::VARCHAR) t;
	--功能查询
  drop table if exists func_tmp1; --事务内多次调用
	CREATE TEMP TABLE func_tmp1 ON COMMIT DROP AS  
	select t.*, '0'::varchar as type from
	"getTargetHisMax"(v_did,v_domain_id,'asyToAfu'::VARCHAR) t;

  v_sql := 'select o2.id, o2.did, o2.vid, o2.revision, o2.project_id,o2.domain_id,o2.name,o.rid||'',''||r.rid::text as rid,''0''::varchar as type 
  from %I o
	join de_object_relation_his r on r.source_object_id = o.did
	and r.domain_id = o.domain_id and r.vid=o.vid and r.revision=o.revision and  r.meta_data_name = $1 
	join de_object_his o2 on o2.did = r.target_object_id
	and o2.domain_id = r.domain_id
  join de_pro_info info on info.object_did=o2.did  and info.domain_id=o2.domain_id
  and info.object_version=o2.revision and info.is_last=''1'' and info.object_vid=o2.vid';

  v_sql1 := 'insert into %I ' || v_sql;
	--运行态：gonna调用场景， 接口调用场景
  EXECUTE format(v_sql1, 'scene_tmp1', 'func_tmp1') USING 'afuToSml';
  EXECUTE format(v_sql1, 'scene_tmp1', 'interface_tmp1') USING 'iflToSml';

  drop table if exists interface1_tmp1; --事务内多次调用
  v_sql2 := 'CREATE TEMP TABLE interface1_tmp1 ON COMMIT DROP AS ' || v_sql;
	
	if v_filter_by_scene then 
				--运行态：场景调用接口
		EXECUTE format(v_sql2, 'scene_tmp1') USING 'smlToIli';
	else 
		--运行态：功能调用接口，接口调用接口
		EXECUTE format(v_sql2, 'func_tmp1') USING 'afuToIfl';
		EXECUTE format(v_sql1, 'interface1_tmp1', 'interface_tmp1') USING 'iliToIli';
		--运行态：场景调用接口
		EXECUTE format(v_sql1, 'interface1_tmp1', 'scene_tmp1') USING 'smlToIli';

		--设计态：查询系统直接调用接口
		insert into interface1_tmp1
		select his.id, his.did, his.vid, his.revision, his.project_id, his.domain_id, his.name, r.rid::text,'0'::varchar as type
		from de_object_relation r 
		join de_object inr on inr.did = r.target_object_id and inr.domain_id = r.domain_id
		join de_view_object_rel rel on rel.object_id = inr.id
		join de_view v on v.id = rel.view_id
		join de_object_his his on his.did= inr.did and his.domain_id=inr.domain_id and his.vid = v.vid
					and his.revision = v.max_version
		where r.source_object_id = v_did
		 and r.domain_id = v_domain_id
		and r.meta_data_name = 'iliToAsy1';
	end if;

	--设计态：接口调用接口， 功能调用接口, 场景调用接口
	v_sql3 := 'select his.id, his.did, his.vid, his.revision, his.project_id,his.domain_id,his.name,o.rid||'',''||r.rid::text as rid,''1''::varchar as type 
  from %I o
	join de_object_relation_his r on r.source_object_id = o.did
	and r.domain_id = o.domain_id and r.vid=o.vid and r.revision=o.revision and  r.meta_data_name = $1
	join de_view v on v.vid=r.vid and v.project_id=r.project_id
	join de_object_his his on his.did = r.target_object_id
	and his.domain_id = r.domain_id and his.vid=r.vid and his.revision=v.max_version
	where not EXISTS (SELECT 1 from %I tmp where tmp.did=his.did and tmp.domain_id=his.domain_id)';

  drop table if exists interface2_tmp1; --事务内多次调用	
	IF v_filter_by_scene THEN 
		EXECUTE 'CREATE TEMP TABLE interface2_tmp1 ON COMMIT DROP AS ' || format(v_sql3, 'scene_tmp1', 'interface1_tmp1') USING 'smlToIli';
	ELSE
		EXECUTE 'CREATE TEMP TABLE interface2_tmp1 ON COMMIT DROP AS ' || format(v_sql3, 'func_tmp1', 'interface1_tmp1') USING 'afuToIfl';
		EXECUTE 'insert into interface2_tmp1 ' || format(v_sql3, 'interface_tmp1', 'interface1_tmp1') USING 'iliToIli';
		EXECUTE 'insert into interface2_tmp1 ' || format(v_sql3, 'scene_tmp1', 'interface1_tmp1') USING 'smlToIli';
	END IF;
  --以下为查找目标系统	
	--接口所属系统
	insert into interface1_tmp1 select * from interface2_tmp1;
  drop table if exists app_tmp1; --事务内多次调用	
	CREATE TEMP TABLE app_tmp1 ON COMMIT DROP AS  
	select o2.id,o2.did,o2.project_id,o2.domain_id,o2.name,o.rid||','||r.rid::text as rid,o.type from interface1_tmp1 o
	join de_object_relation r on r.target_object_id = o.did
	and r.domain_id = o.domain_id and r.meta_data_name = 'iliToAsy2'
	join de_object o2 on o2.did = r.source_object_id
	and o2.domain_id = r.domain_id;

	RETURN QUERY SELECT t.id,t.did,t.project_id,t.domain_id,t.name,v.id,t.rid,t.type FROM app_tmp1 t
	join de_view_object_rel r on r.object_id = t.id
	and r.type='2'
	join de_view v on v.id = r.view_id and v.status<>'0';  

	RETURN;

END;
$_$;


--
-- Name: storagepoolusage(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION storagepoolusage(enddate character varying) RETURNS TABLE(stgpoolid character varying, name character varying, type character varying, category character varying, poolcap numeric, volqty integer, usedcap numeric, allocated numeric)
    LANGUAGE plpgsql
    AS $_$
DECLARE 
endDateTime VARCHAR;
BEGIN
IF $1 = '' or $1 is null THEN
	select '3000-01-01' into endDateTime;
ELSE
	select $1||' 23:59:59' into endDateTime;
END If;
raise notice 'endDateTime is: %', endDateTime;

	RETURN QUERY 
	SELECT 	LEAST (o1."Code", o2."Code") :: VARCHAR AS "StgPoolId",
			LEAST (o1.name, o2.name) :: VARCHAR AS name,
			LEAST (o1."type", o2."type") :: VARCHAR AS "type",
			LEAST (o1."category", o2."category") :: VARCHAR AS "category",
			ROUND(COALESCE (o1.poolcap, 0) / 1024, 2) :: NUMERIC AS "poolcap",
			COALESCE (o2.volqty, 0) :: INTEGER AS "volqty",
			ROUND(COALESCE (o2.usedcap, 0) / 1024, 2) :: NUMERIC AS "usedcap",
			COALESCE (ROUND(o2.usedcap / o1.poolcap * 100, 2), 0) :: NUMERIC AS "allocated"
	FROM (
		SELECT 	o1.data ->> 'Id' AS "Id", 
				o1.data ->> 'Code' AS "Code", 
				o1.name, 
				o1.data ->> 'type' AS type,
				o1.data ->> 'category' AS category,
				SUM(translate_to_number(o2.data ->> 'capacity') * translate_to_number(o2.data ->> 'copy')) AS poolcap		
		FROM de_object o1
		JOIN "findObjectByIdAndMetaViewName"('StoragePool_V') v ON v.object_id = o1.id
		LEFT JOIN de_object_relation r ON r.source_object_id = o1.did
		JOIN "findObjectByMetaViewName"('StorageVolume_V') o2 ON o2.did = r.target_object_id
		WHERE o2.data ->> 'objStatus' IN ('70906', '70907')
			and o2.created_time <= endDateTime::timestamp
		GROUP BY o1.data ->> 'Id', o1.data ->> 'Code', o1.name, o1.data ->> 'type', o1.data ->> 'category'
	) o1
	FULL JOIN (
		SELECT 	o1.data ->> 'Id' AS "Id",
				o1.data ->> 'Code' AS "Code",
				o1.name,
				o1.data ->> 'type' AS type,
				o1.data ->> 'category' AS category,
				COUNT (*) AS volqty,
				SUM (translate_to_number(o2.data ->> 'capacity') * translate_to_number(o2.data ->> 'copy')) AS usedcap
		FROM de_object o1
		JOIN "findObjectByIdAndMetaViewName"('StoragePool_V') v ON v.object_id = o1.id
		LEFT JOIN de_object_relation r ON r.target_object_id = o1.did
		JOIN "findObjectByMetaViewName"('StorageVolume_V') o2 ON o2.did = r.source_object_id
		WHERE o2.data ->> 'objStatus' IN ('70906', '70907')
			and o2.created_time <= endDateTime::timestamp
		GROUP BY o1.data ->> 'Id', o1.data ->> 'Code', o1.name, o1.data ->> 'type', o1.data ->> 'category'
	) o2 ON o1."Id" = o2."Id"
	ORDER BY o1.poolcap DESC;
END ;
$_$;


--
-- Name: storageusage(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION storageusage(enddate character varying) RETURNS TABLE(category text, level text, cnt bigint, capacity numeric, usedcap numeric, allocated text, utilized text)
    LANGUAGE plpgsql
    AS $_$
DECLARE 
endDateTime VARCHAR;
BEGIN
IF $1 = '' or $1 is null THEN
	select '3000-01-01' into endDateTime;
ELSE
	select $1||' 23:59:59' into endDateTime;
END If;
raise notice 'endDateTime is: %', endDateTime;

	RETURN QUERY 
	SELECT	lookup(o1.category) :: TEXT AS category,
			o1.level :: TEXT AS level,
			o1.cnt AS cnt,
			o1.capacity AS capacity,
			o1.usedcap AS usedcap,
			o1.allocated ||'%' AS allocated,
			ROUND((o1.capacity - o2.unused) / o1.capacity * 100, 2) ||'%' AS utilized
	FROM (
		SELECT	o.category, 
				lookup(o.level) AS level,
				o.cnt,
				o.capacity,
				o2.usedcap,
				ROUND(o2.usedcap / o.capacity * 100, 2) AS allocated
		FROM (
			SELECT 	o.data ->> 'storagecategory' AS category,
					o.data ->> 'storagelevel' AS level,
					COUNT (*) AS cnt,
					SUM(translate_to_number(o.data ->> 'capacity')) AS capacity
			FROM de_object o
			JOIN "findObjectByIdAndMetaViewName"('Storage_V') v ON v.object_id = o.id
			WHERE o.data ->> 'storagetype' != '70429' AND o.data ->> 'objStatus' != 'Purchasing' AND o.created_time <= endDateTime::timestamp
			GROUP BY o.data ->> 'storagecategory', o.data ->> 'storagelevel'
		) o
		JOIN (
			SELECT	o.category, o.level, o.usedcap + o2.usedcap - COALESCE(o2.poolcap, 0) AS usedcap		
			FROM (
				SELECT	o2.data ->> 'storagecategory' AS category,
						o2.data ->> 'storagelevel' AS "level",
						ROUND(SUM(translate_to_number(o1.data ->> 'capacity') * translate_to_number(o1.data ->> 'copy') / 1024), 2) AS usedcap		
				FROM de_object o1
				JOIN "findObjectByIdAndMetaViewName"('StorageVolume_V') v ON v.object_id = o1.id
				LEFT JOIN de_object_relation r ON r.source_object_id = o1.did
				JOIN "findObjectByMetaViewName"('Storage_V') o2 ON o2.did = r.target_object_id AND o2.data ->> 'objStatus' != 'Purchasing'
				WHERE o1.data ->> 'objStatus' IN ('70906', '70907')
						and o1.created_time <= endDateTime::timestamp
						and o2.created_time <= endDateTime::timestamp
				GROUP BY o2.data ->> 'storagecategory', o2.data ->> 'storagelevel'
			) o
			LEFT JOIN (
				SELECT 	o.category, 
						o.type,
						o.poolcap - COALESCE(o2.poolcap, 0) AS poolcap,
						o.usedcap - COALESCE(o2.poolcap, 0) AS usedcap
				FROM (							
					SELECT 	o.category,
							o.type,
							SUM(o.poolcap) AS poolcap,
							SUM(o.usedcap) AS usedcap
					FROM storagepoolusage($1) o
					GROUP BY o.category, o.type 
				) o
				LEFT JOIN (
					SELECT	o.category,
							o.type,
							SUM(o.poolcap) AS poolcap
					FROM storagepoolusage($1) o
					WHERE o.name LIKE '%VMWare%' 
					OR o.name LIKE '%NFS%'
					GROUP BY o.category, o.type 
				) AS o2 ON o2.category = o.category AND o2.type = o.type
			) o2 ON o2.category = o.category AND lookup(o2.type) = lookup(o.level)
		) o2 ON o2.category = o.category AND o2.level = o.level
	) o1,
	(
		SELECT 	o.category AS category,
				o.storagelevel AS storagelevel, 
				SUM(o.unused) AS unused
		FROM (
			(
				SELECT 	o.data ->> 'storagecategory' AS category,
						lookup(o.data ->> 'storagelevel') AS storagelevel,
						SUM(translate_to_number(o.data ->> 'unused')) AS unused
				FROM de_object o
				JOIN "findObjectByIdAndMetaViewName"('Storage_V') v ON v.object_id = o.id
				WHERE o.data ->> 'storagetype' != '70429' AND o.data ->> 'objStatus' != 'Purchasing'
					and o.created_time <= endDateTime::timestamp
				GROUP BY o.data ->> 'storagecategory', o.data ->> 'storagelevel'
			)
			UNION ALL (
				SELECT	o.data ->> 'category' AS category,
						lookup(o.data ->> 'type') AS storagelevel,
						SUM(translate_to_number(o.data ->> 'unused')) AS unused
				FROM de_object o
				JOIN "findObjectByIdAndMetaViewName"('StoragePool_V') v ON v.object_id = o.id			
				GROUP BY o.data ->> 'category', o.data ->> 'type'
			)
		) o
		GROUP BY o.category, o.storagelevel
	) o2
	WHERE o1.category = o2.category AND o1.level = o2.storagelevel
	ORDER BY o1.level;
 END ;
$_$;


--
-- Name: tradinglineanalysismainfunc(character varying, character varying, character varying, boolean); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION tradinglineanalysismainfunc(i_did character varying, i_meta_data_name character varying, i_domain_id character varying, i_reverse boolean) RETURNS TABLE(id character varying, name character varying, domain_id character varying, view_id character varying, parent_id character varying, meta_view_name character varying, meta_data_name character varying, revision character varying, pro_info character varying)
    LANGUAGE plpgsql
    AS $_$ 
DECLARE 
left_temp_table_count INT ;
right_temp_table_count INT ;
BEGIN

IF $4 THEN
raise notice 'is right:%',$4;

select count(1) from pg_tables where tablename = 'app_liang1' into right_temp_table_count;
 raise notice 'is right table exist:%',right_temp_table_count;
IF right_temp_table_count =0 THEN
 CREATE TEMP TABLE app_liang1 ON COMMIT DROP AS   
 select null::VARCHAR as id,null::VARCHAR as name,null::VARCHAR as domain_id,null::VARCHAR as view_id,null::VARCHAR as parent_id,null::VARCHAR as meta_view_name,null::VARCHAR as meta_data_name,null::VARCHAR as revision,null::VARCHAR as pro_info;
ELSE
 DELETE from app_liang1;
END IF;
 
 
PERFORM "TradingLineAnalysisLoopFuncRight"($1,'app_liang1',$2,$3,'0');

	RETURN QUERY select * from app_liang1 t where t.id is not null;
ELSE
raise notice 'is left:%',$4;
select count(1) from pg_tables where tablename = 'app_liang2' into right_temp_table_count;
 raise notice 'is right table exist:%',right_temp_table_count;
IF right_temp_table_count =0 THEN
 CREATE TEMP TABLE app_liang2 ON COMMIT DROP AS   
 select null::VARCHAR as id,null::VARCHAR as name,null::VARCHAR as domain_id,null::VARCHAR as view_id,null::VARCHAR as parent_id,null::VARCHAR as meta_view_name,null::VARCHAR as meta_data_name,null::VARCHAR as revision,null::VARCHAR as pro_info;
ELSE
 DELETE from app_liang2;
END IF;
 PERFORM "TradingLineAnalysisLoopFuncLeft"($1,'app_liang2',$2,$3,'0');

	RETURN QUERY select * from app_liang2 t where t.id is not null;
END IF;



END; $_$;


--
-- Name: translate_to_number(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION translate_to_number(x character varying, OUT y numeric) RETURNS numeric
    LANGUAGE sql
    AS $_$
SELECT
    CASE WHEN x ~ '^([0-9]+[.]?[0-9]*|[.][0-9]+)$' THEN
			to_number(x, '999999999.99')
		else
    	0 END;

$_$;


--
-- Name: update_tm_project_plan_instance(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION update_tm_project_plan_instance() RETURNS void
    LANGUAGE plpgsql
    AS $$
BEGIN
update tm_project_plan_version
		set plan_instance_id = null
where char_length(plan_instance_id) < 25;

insert into tm_project_plan_instance
select nextval('tm_project_plan_instance_id_seq') as id,
			 '主计划' as name,
			 t.project_id as main_plan_id,
			 '1' as project_instace_type,
			 null as creator_id,
			 now() as created_time,
			 null as modifier_id,
			 null as modified_time,
			 '1' as status,
			 t.project_id as project_id from 
			(select * from tm_project_plan_version tppv
			 where tppv.project_id not in (select tppi.project_id from tm_project_plan_instance tppi group by tppi.project_id)) t
			 group by t.project_id;

update tm_project_plan_version 
		set plan_instance_id = tppi.id from 
		tm_project_plan_instance tppi
		where tm_project_plan_version.project_id=tppi.project_id
		and tm_project_plan_version.plan_instance_id is null;

END
 $$;


