--
-- Name: view_service_scene; Type: MATERIALIZED VIEW; Schema: public; Owner: -; Tablespace: 
--

CREATE MATERIALIZED VIEW view_service_scene AS
 WITH RECURSIVE cte AS (
         SELECT '0'::character varying AS parent_id,
            obj.name,
            obj.id,
            obj.did,
            obj.project_id,
            obj.meta_data_name,
            obj.domain_id,
            obj.data,
            0.0 AS rel_version,
            ''::character varying AS rid,
            ''::character varying AS parentid,
            ''::character varying AS rel_meta_data_name
           FROM (de_object_relation rel
             JOIN de_object obj ON (((rel.target_object_id)::text = (obj.did)::text)))
          WHERE (((rel.type = 2::numeric) AND ((rel.source_object_id)::text = '0'::text)) AND ((obj.meta_data_name)::text = ANY ((ARRAY['Class'::character varying, 'Service'::character varying])::text[])))
        UNION ALL
         SELECT (((c.parent_id)::text || ','::text) || (c.did)::text) AS parent_id,
            obj.name,
            obj.id,
            obj.did,
            obj.project_id,
            obj.meta_data_name,
            obj.domain_id,
            obj.data,
            rel.version AS rel_version,
            rel.rid,
            rel.source_object_id AS parentid,
            rel.meta_data_name AS rel_meta_data_name
           FROM ((cte c
             JOIN de_object_relation rel ON ((((rel.source_object_id)::text = (c.did)::text) AND ((rel.domain_id)::text = (c.domain_id)::text))))
             JOIN de_object obj ON ((((rel.target_object_id)::text = (obj.did)::text) AND ((rel.domain_id)::text = (obj.domain_id)::text))))
          WHERE (rel.type = 2::numeric)
        )
 SELECT t.parent_id,
    t.name,
    t.id,
    t.did,
    t.project_id,
    t.meta_data_name,
    t.domain_id,
    t.data,
    t.rel_version,
    t.rid,
    t.parentid,
    t.rel_meta_data_name,
    (obj_sertosml.data ->> 'num'::text) AS pnum
   FROM ((cte t
     LEFT JOIN de_object_relation rel_sertosml ON ((((rel_sertosml.target_object_id)::text = (t.did)::text) AND ((rel_sertosml.meta_data_name)::text = 'serToSml'::text))))
     LEFT JOIN de_object obj_sertosml ON (((obj_sertosml.did)::text = (rel_sertosml.source_object_id)::text)))
  WHERE ((t.meta_data_name)::text = ANY ((ARRAY['ServiceMethodList'::character varying, 'Service'::character varying])::text[]))
  WITH NO DATA;


--
-- Name: view_system_application; Type: MATERIALIZED VIEW; Schema: public; Owner: -; Tablespace: 
--

CREATE MATERIALIZED VIEW view_system_application AS
 WITH RECURSIVE cte AS (
         SELECT '0'::character varying AS parent_id,
            obj.name,
            obj.id,
            obj.did,
            obj.project_id,
            obj.meta_data_name,
            obj.domain_id,
            obj.data,
            0.0 AS rel_version,
            ''::character varying AS rid,
            ''::character varying AS parentid,
            ''::character varying AS rel_meta_data_name
           FROM (de_object_relation rel
             JOIN de_object obj ON (((rel.target_object_id)::text = (obj.did)::text)))
          WHERE (((rel.type = 2::numeric) AND ((rel.source_object_id)::text = '0'::text)) AND ((obj.meta_data_name)::text = 'ApplicationLayer'::text))
        UNION ALL
         SELECT (((c.parent_id)::text || ','::text) || (c.did)::text) AS parent_id,
            obj.name,
            obj.id,
            obj.did,
            obj.project_id,
            obj.meta_data_name,
            obj.domain_id,
            obj.data,
            rel.version AS rel_version,
            rel.rid,
            rel.source_object_id AS parentid,
            rel.meta_data_name AS rel_meta_data_name
           FROM ((cte c
             JOIN de_object_relation rel ON ((((rel.source_object_id)::text = (c.did)::text) AND ((rel.domain_id)::text = (c.domain_id)::text))))
             JOIN de_object obj ON ((((rel.target_object_id)::text = (obj.did)::text) AND ((rel.domain_id)::text = (obj.domain_id)::text))))
          WHERE (rel.type = 2::numeric)
        )
 SELECT t.parent_id,
    t.name,
    t.id,
    t.did,
    t.project_id,
    t.meta_data_name,
    t.domain_id,
    t.data,
    t.rel_version,
    t.rid,
    t.parentid,
    t.rel_meta_data_name
   FROM cte t
  WHERE ((t.meta_data_name)::text = 'ApplicationSystem'::text)
  WITH NO DATA;


